function copyToPartsBin(morph) {
    var name = this.get('NameText').textString

    var info = morph.getPartsBinMetaInfo();
    morph.setName(name);

    info.partsSpaceName = this.get('CategoryText').textString
    info.comment = this.get('CommentText').textString

    if (! info.changes) info.changes = [];
    var change = { 
        date: new Date(), 
        author: this.world().getUserName(), 
        message: this.get('CommitMessageText').textString,
        id: Strings.newUUID()
    }
    info.changes.push(change)    

    morph.copyToPartsBin();
}

