function setTarget(morph) {
    this.target = morph 
    if (!morph) {
        this.get('NameText').textString = '';
        this.get('CategoryText').textString = '';
        this.get('CommentText').textString = '';        
        this.get('CommitMessageText').textString = ''      
        return
    }
    var info = this.target.getPartsBinMetaInfo();
    this.get('NameText').textString = info.partName || morph.getName();
    this.get('CategoryText').textString = info.partsSpaceName;
    this.get('CommentText').textString = info.comment;        
    this.get('CommitMessageText').textString = ''        

}

